1.23.description:
This parameter is used for a Table request. It decides whether to include each object along with its columnar information. Valid values are:

- `"None"`: return no object;
- `"Object"` return the full object contents;
- `"Metadata"`: (the default) return the object's metadata in the PartialObjectMetadata kind in version v1beta1 of the `"meta.k8s.io"` API group.

