1.23.description:
When specified with a **watch** call, shows changes that occur after that particular version of a resource. Defaults to changes from the beginning of history. When specified for **list**:

- if unset, then the result is returned from remote storage based on quorum-read;
- if it is `"0"`, the server returns the objects in cache, no guarantee;
- if set to non-zero string, the result is at least as fresh as the given `resourceVersion`.

